            "name": "#772 Lucas",
            "description": "<p>Es handelt sich um ein Grundst\u00fcck in einem kleinen Wald direkt am Fluss. Dort habe ich eine kleine H\u00fctte stehen und H\u00fchner. Eine Toilette gibt es nur in Form eines Plumpsklos. Dort ist man sch\u00f6n alleine, es gibt keine Nachbarn. Ein sch\u00f6ner ruhiger Ort. <\/p>\n<p>F\u00fcr Infos zum Ort k\u00f6nnt ihr auch auf Instagram schauen: @die__huette<br \/>\nIch m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
