            "description": "<p>Liebe Bikepacker und Backpacker,<br \/>\nihr k\u00f6nnt in unserem kleinen Garten 1 kleines Zelt f\u00fcr 1 Nacht aufstellen.<br \/>\nFlie\u00dfendes Wasser gibts im Garten.<br \/>\nBitte nur ruhige G\u00e4ste und keine Tiere.<br \/>\n\u00dcbernachtungen sind nur m\u00f6glich, wenn ich zu Hause bin. <\/p>\n<p>Bitte meldet Euch deshalb bitte vorher per Email bei mir an.<br \/>\n-----------------------------------------------<br \/>\nDear bikepackers and backpackers,<br \/>\nyou are welcome to set up 1 small tent for 1 night in our small garden.<br \/>\nThere is tiling water in the garden.<br \/>\nPlease only quiet guests and no animals. <\/p>\n<p>Overnight stays are only possible when I am at home. Please contact me in advance via email.<\/p>\n",
