            "description": "<p>- Biete \u00dcbernachtungsm\u00f6glichkeiten in meinem Garten \/ Zentral in Lingen<br \/>\n- Zelten ohne Probleme m\u00f6glich<br \/>\n- Wohnwagen bzw. Wohnmobile unter Umst\u00e4nden auch m\u00f6glich<br \/>\n- Bei starken Unwetter  steht auch ein \u00fcberdachter Bereich zur Verf\u00fcgung<br \/>\n- G\u00e4ste WC vorhanden \/ Dusche auf Anfrage kein Problem<br \/>\n- flie\u00dfend Wasser vorhanden<br \/>\n- Gartenm\u00f6bel, Grill, zwei Feuerstellen stehen zur Verf\u00fcgung<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n0170\/2473063<\/p>\n",
