            "description": "<p>We have a tiny garden, but since we love guests, we'd still like to offer you to stay there for a few nights.<br \/>\nIt's 1 min from the lake and very central.<br \/>\nOn Wednesday and Saturday there's a market nearby which is lovely. And the best icecream in town is sold in our street.<br \/>\nUnfortunately, we can't offer a toilet or bathroom. So you would have to use a public one. Although we love pets, we also love our neighbours. Since there are a lot of balconies around the garden, it shouldn't be too noisy.<\/p>\n<p>I want you to conteact me before visiting.<\/p>\n",
