            "description": "<p>Liebe alle, wir sind ein kleiner Selbstversorgerhof und WG-Hof bei Eberswalde und Berlin und haben immer gern einen Platz f\u00fcr Euch!<\/p>\n<p>Wir, 7 Gro\u00dfe um die 40 Jahre und 4 Kids und Jugendliche, leben auf 8000qm. Du kannst hier mit uns den Gem\u00fcsegarten, Feuerstelle, Spielplatz, Werkstatt und mehr teilen. Viele Tiere wie Schafe, H\u00fchner, Enten leben hier. Ein Badesee umme Ecke, viel Geselligkeit, gemeinsam kochen, am Kamin schnacken, und dennoch, wer es braucht, den Sonnenuntergang in Ruhe und Stille neben deinem Zelt auf der Schafweide genie\u00dfen - wir freuen uns \u00fcber Besuch und hei\u00dfen dich herzlich willkommen! Ein G\u00e4steh\u00fcttchen und ein Wohnwagen f\u00fcr Regentage oder l\u00e4ngere Aufenthalte stehen auch zur Verf\u00fcgung.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n01753277306<\/p>\n",
