            "description": "<p>Hallo,<br \/>\nbei Regen haben wir eine Gartenlaube + Kickertisch.<br \/>\nAnsonsten im Garten: Sandkasten, kleine Turnstangen, Kletterhaus mit Rutsche. Zugang zum kalten Bach (Kann man durchlaufen, ist aber kalt) mit Blick auf den M\u00fchlenteich (Nicht schwimmbar, Nicht zum angeln). \u00d6ffentlicher Kinderspielplatz in n\u00e4chster N\u00e4he, Supermarkt (Penny) fu\u00dfl\u00e4ufig erreichbar.<br \/>\nZugang zur Toilette nach Absprache.<br \/>\nEinen Wasserhahn mit Trinkwasser gibt es au\u00dfen am Haus.<br \/>\nTiere sind erlaubt, wenn sie die Katze nicht fressen, wir sind hier nicht auf Melmac ;-)<br \/>\nEine Feuerstelle gibt's in Form einer Feuerschale, grillen ist erlaubt.<\/p>\n<p>Wer keinen Kaffee mag, bekommt Tee.<br \/>\nFragen gerne fragen, Adresse per Mail.<br \/>\nIch m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail  bei mir anmelden.<br \/>\nSo Long, and Thanks for All the Fish<br \/>\nLG<\/p>\n",
