            "description": "<p>Hallo liebe Abenteurer,<\/p>\n<p>ich lade euch herzlich ein in meinem gro\u00dfen Garten zu Zelten. Bei ganz schlechtem Wetter besteht die M\u00f6glichkeit in der Scheune zu schlafen. Dort ist auch eine Toilette und ein Waschbecken vorhanden. Desweiteren besteht hier die M\u00f6glichkeit, Handys aufzuladen und die Fahrr\u00e4der sicher unterzustellen. Im K\u00fchlschrank ist immer ein Kaltgetr\u00e4nk vorhanden. <\/p>\n<p>Haustiere bitte nur nach Absprache.<\/p>\n<p>Ich freue mich auf euren Besuch und eure Geschichten.<br \/>\nIch m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015229810318<\/p>\n<p>Viele Gr\u00fc\u00dfe,<br \/>\nJohannes<\/p>\n<p>-------------------------------------<\/p>\n<p>Hello dear adventurers,<\/p>\n<p>I warmly invite you to camp in my large garden. In case of very bad weather, there's the option to sleep in the barn, where a toilet and a sink are also available. Additionally, you can charge your phones here and securely store your bicycles. There's always a cold drink in the fridge.<\/p>\n<p>Please consult me before bringing any pets.<\/p>\n<p>I look forward to your visit and your stories.<br \/>\nPlease, contact me before visiting 015229810318<\/p>\n<p>Best Regards<br \/>\nJohannes<\/p>\n",
