            "description": "<p>Hallo! Meldet euch bitte unbedingt per Email, bevor ihr kommt. Der Platz ist in unserem Garten und daher nur zug\u00e4nglich wenn wir da sind.<br \/>\nEs gibt eine \u00f6ffentliche Toilette im Ort (6 min zu Fu\u00df) oder eine in unserer Wohnung. Unser Garten ist keine Toilette!<br \/>\nWir haben Platz f\u00fcr ein Zelt mit 2 Personen. Kinder sind willkommen. F\u00fcr die Kleinen gibts auch einen Sandkasten zum Spielen.<br \/>\nIhr wacht morgens mit Sonne im Gesicht auf und habt einen wundersch\u00f6nen Bergblick auf die Kampenwand.<br \/>\nDer Garten ist mitten in einer Wohnsiedlung. Wir bitten euch also euch ruhug zu verhalten, damit wir das \u00dcbernachtungsangebot weiter aufrecht erhalten k\u00f6nnen. Ihr werdet daf\u00fcr selbst auch ruhig schlafen. Es gibt kaum Verkehrsl\u00e4rm und nur die V\u00f6gel machen sich morgens bemerkbar.<br \/>\nWenn ihr ohne Zelt unterwegs seid k\u00f6nnt ihr (max zu 2) auf unserer Terasse schlafen. Die ist von einem Balkon \"\u00fcberdacht\".<br \/>\nDie kalte Au\u00dfendusche k\u00f6nnt ihr gerne benutzen. Abk\u00fchlung gibts sonst auch im Chiemsee. Der ist mit dem Rad 4 min entfernt.<br \/>\nSupermarkt\/B\u00e4cker\/Restaurants\/Apotheke gibts alles fu\u00dfl\u00e4ufig erreichar im Ort.<br \/>\nGute Reise!<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
