            "description": "<p>Wer wandert oder mit dem Fahrrad reist, ist bei uns willkommen. Stellpl\u00e4tze f\u00fcr motorisierte Reisende k\u00f6nnen wir nicht anbieten. Unser Grundst\u00fcck befindet sich im Wald und in Seen\u00e4he. Wir haben Platz f\u00fcr 2 Zelte. Strom und Aussenklo vorhanden. Aussendusche und Waschbecken jeweils mit Warmwasser. Supermarkt ca. 5 km. im Nebendorf.<br \/>\nBitte vorab per email anfragen. Lieben Dank!<br \/>\n---------<br \/>\nIf you're a cyclist or a hiker you are welcome. We can't provide spaces for caravans or mobile homes etc.<br \/>\nWe provide space for 2 tents, warmshower, toilet and electricity. Supermarket is 5 km away in the next village.<br \/>\nPlease get in touch in advance via email.  Thank you.<\/p>\n",
