            "description": "<p>Ich stelle gerne meinen Garten f\u00fcr Zelte von Radreisenden zur Verf\u00fcgung!<br \/>\nWenn ich zuhause bin gibt es Wasser, WC, Strom und Feuerstelle mit Grillm\u00f6glichkeit gegen einen kleinen Beitrag.<br \/>\nBitte s\u00e4mtlichen M\u00fcll wieder mitnehmen.<br \/>\nIn der N\u00e4he gibt es einen B\u00e4cker und einen Supermarkt.<br \/>\nBitte keine Haustiere. <\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail \/ What'sApp oder Telefon bei mir anmelden.\u2028 d_martinelli@gmx.at, +43\/660\/7095011<\/p>\n<p>I\u2018m happy to share my garden with Bikepackers.<br \/>\nIf I am at home, Water, WC, electricity and a fireplace available for some little bucks.<br \/>\nPlease take all your rubbish with you.<br \/>\nNo pets. <\/p>\n<p>I want visitors to contact me before camping at my place via email or phone.  d_martinelli@gmx.at, +43\/660\/7095011<\/p>\n",
