            "description": "<p>Wir bieten einen Zeltplatz f\u00fcr 1 bis 2 Personen auch mit Kind. Falls ihr einen Hund dabei habt, sollte der auf keinem Fall Tiere jagen, bitte gebt einen Hund immer vorher an, da wir selbst 2 von den Fellnasen haben. Falls ihr mit Pferd oder Esel unterwegs seit, d\u00fcrfte das auch kein Problem f\u00fcr uns darstellen.<br \/>\nWir haben eine Toilette mit Dusche, die nach Absprache bei Ankunft und gegen Unkostenbeitrag f\u00fcr die Aufenthaltsdauer benutzt werden kann. Auch einen Aufenthalts oder Schlafbereich k\u00f6nnen wir zur Verf\u00fcgung stellen, vor allem bei sehr schlechtem Wetter.<br \/>\nUnser Mehrwert ist Leute kennen zu lernen, die ehrlich sind und das Angebot zu sch\u00e4tzen wissen. Leute denen was an Natur, Garten und Tieren liegt sind immer willkommen.  \u00dcbrigens wir sind ein schwules Paar, damit solltet ihr keine Probleme haben.<br \/>\nSpontane Anmeldung geht oft auch, aber wenn m\u00f6glich so 3 Tage vorher mal Bescheid geben.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n017654744351<\/p>\n",
