            "description": "<p>Der Zeltplatz befindet sich auf einer freien Fl\u00e4che mitten im Ortsteil Bahnhof in Ottersberg. Insgesamt ist die Fl\u00e4che knapp zwei Hektar gro\u00df und von H\u00e4usern umgeben.  Der zur Verf\u00fcgung stehende Zeltplatz ist nur auf einem Teil der Fl\u00e4che, die wir f\u00fcr ein Gemeinschaftsgartenprojekt von der Gemeinde Ottersberg gepachtet haben, erw\u00fcnscht.<br \/>\nEs gibt eine Feuerschale, einen Tisch, Gartenst\u00fchle, ein Gew\u00e4chshaus, eine Kr\u00e4uterspirale und  Gem\u00fcse und Blumenbeete, eine Schw\u00e4ngelpumpe f\u00fcr Grundwasser (im Aufbau, nicht zum trinken ), ein Weidenh\u00e4uschen zum Spielen f\u00fcr die Kinder, ein Kindertisch und gro\u00dfe Heuballen.<br \/>\nToilette und Dusche kann bei mir zu Hause genutzt werden (wenn ich zu Hause bin). Ich wohne nur etwa 100 m entfert, dort gibt es auch eine Tischtennisplatte.  Hunde sind erlaubt wenn darauf geachtet wird, dass sie die Beete nicht besch\u00e4digen.<br \/>\nDie W\u00fcmme ist fu\u00dfl\u00e4ufig erreichbar, Baden in der W\u00fcmme ist m\u00f6glich.<\/p>\n",
