            "description": "<p> Auf meiner Wiese (morgens manchmal etwas laut, weil an der Stra\u00dfe gelegen, aber gesch\u00fctzt) ist Zelten oder Schlafen unter freiem Himmel m\u00f6glich - zuweilen auch in meinem Klein-Garten. Den genauen Ort teile ich euch am Telefon oder per Mail mit. Es gibt weder flie\u00dfend Wasser noch eine Toilette, auch keine M\u00fcllentsorgung. Daf\u00fcr aber eine Bank mit Tisch (ausklappbar) und einen sch\u00f6nen Blick. Weil ich nach eurer Abreise keine F\u00e4kalien auf dem Land finden m\u00f6chte, auch keine vergrabenen und auch kein Leergut und keine Lebensmittelreste, solltet Ihr nur kommen, wenn ihr in der Lage seid, alles wieder mitzunehmen und im n\u00e4chsten \u00f6ffentlichen M\u00fclleimer zu entsorgen. Pinkeln kann man\/frau auf der Wiese, aber bitte nicht in den Knick pinkeln, wo es sonst stinken und die Pflanzen sch\u00e4digen w\u00fcrde. Ich werde versuchen F\u00e4kalien-T\u00fcten zur Verf\u00fcgung zustellen, die ihr bitte NICHT im n\u00e4chsten Graben entsorgt. Willkommen sind alle netten Leute, die wandernd oder mit den Fahrrad reisen. Zwei Personen sind ok. Alles andere auf Anfrage. Schreibt mir am Besten vorher eine Mail. Ein paar Zeilen \u00fcber Euch und Eure Reise w\u00fcrden mich freuen. Ein Anruf am Anreisetag w\u00e4re vorteilhaft: Tel 01577 245 23 19<\/p>\n<p>Ich m\u00f6chte dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n<p>Kontakt: andrea.angeln@posteo.de<\/p>\n",
