            "description": "<p>In direkter N\u00e4he zum Hufeisensee liegt das Grundst\u00fcck von Familie Koch. Hier kann auf dem Parkplatz am Haus oder auf der Rasenfl\u00e4che im Garten \u00fcbernachtet werden. Frau und Herr Koch sind Mitte 50 und berufst\u00e4tig. Sie sind selbst gern mit dem Bully unterwegs und freuen sich immer, nette Leute kennenzulernen.<\/p>\n<p>Allgemeine Informationen:<br \/>\nStellplatz geeignet f\u00fcr: Zelt, Wohnmobil<br \/>\nVerf\u00fcgbare Fl\u00e4che: 1 Stellplatz f\u00fcr Zelt, 1 Stellplatz f\u00fcr Fahrzeug bis 6m auf einem Parkplatz am Haus<br \/>\nVerf\u00fcgbarkeit: April bis August<br \/>\nAufenthaltsdauer: 1 Nacht auf dem Parkplatz, bis zu 5 Tage im Garten<\/p>\n<p>Angaben zum Stellplatz:<br \/>\nDer Stellplatz f\u00fcr das Fahrzeug ist gepflastert, Campingm\u00f6bel k\u00f6nnen nicht aufgestellt werden. Der Untergrund der Zeltfl\u00e4che ist Rasen.<\/p>\n<p>Zudem befindet sich der Stellplatz nahe des Hufeisensees. Der 6,5 km Rundweg um das Ufer l\u00e4dt ein zum Spazieren oder Joggen, auf der asphaltierten Promenade gar zum Skaten und Radeln ein. Im angrenzenden Golfpark werden indes ganz andere Eisen geschwungen, auf dem Kurzplatz gern auch ohne Platzreife. Achtung:  Das Baden ist leider aus Sicherheitsgr\u00fcnden im Hufeisensee nicht erlaubt.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n+49 (0) 159 O116 6597<\/p>\n",
