            "description": "<p>\u00dcbernachtungsplatz f\u00fcr Zeltende, sowie Stellplatz f\u00fcr Wohnmobile und PKW f\u00fcr jeweils nicht mehr als 24 h direkt auf gem\u00e4hten Arealen des Beobachtungsfeldes des Tannenhof Mei\u00dfers. Bl\u00fchwiesen rundherum, Wanderm\u00f6glichkeiten und Badestelle Schweriner Au\u00dfensee 25 min fu\u00dfl\u00e4ufig. Unser Kompostklo erm\u00f6glicht es uns, Eure Kaka in schwarzes Gold zu verwandeln und die Bodenfruchtbarkeit zu pushen. *** Bitte meldet Euch vor Anreise unbedingt an (kurzfristig telefonisch unter 0152 027 46 654 bzw. 072 84 23 783, langfristig per E-Mail tannenhof_meisser@yahoo.de) und befahrt die Fl\u00e4che erst nach unserer Zusage. Besucht dazu unsere Website https:\/\/www.tannenhof-meisser.de\/wildes-zelten-am-tannenhof.php. Eine tolle Zeit bei uns w\u00fcnscht Euch Familie Mei\u00dfer.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n0152 027 46 654<\/p>\n",
