            "description": "<p>Servus Leut!<br \/>\nKommt rum, macht Rast und werft euer Zelt bei mir in den Garten.<br \/>\nSchaukel und Rutsche ist auch vorhanden!<br \/>\nWenn ich daheim bin gibt\u00b4s auch Strom, Wasser und Toilette.<br \/>\nFeuerschale und Grill kann auch gestellt werden wenn es passt.<br \/>\nBei Defekten am Radl kann ich gerne behilflich sein.  Abends kann man sich auch gern mal zusammen setzen.<br \/>\nIn den Sommermonaten gibts auch das ein oder andere Gem\u00fcse zu pfl\u00fccken.<br \/>\nAnsonsten gibt\u00b4s im Ort eine Tanke f\u00fcr die kleinen Besorgungen.<br \/>\nSagt mir aber bitte vorher Bescheid wenn ihr kommt.<br \/>\nMotorisierte Anreise schlie\u00dfe ich jedoch aus, Ebike ist jedoch ok^^<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n0151-5460544 undneAcht zuletzt<\/p>\n",
