            "description": "<p>Hier gibt es Aufstellm\u00f6glichkeit f\u00fcr 3 - 4 Zelte. Ausschlie\u00dflich f\u00fcr Radfahrer und Wanderer. Lagerfeuerplatz und Au\u00dfenk\u00fcche sind vorhanden. Bei schlechtem Wetter haben wir gen\u00fcgend Platz im Speicher. Kompostklo vorhanden. Badem\u00f6glichkeit im Flu\u00df (1 km). \u00d6ko und Nachhaltigkeit sind uns wichtig.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n0157 88875901<\/p>\n",
