            "description": "<p>Hello! We have a meadow in front of the house and a meadow behind the house. On both it is possible to pitch a large tent and it is, at least on one meadow, completely ground level. You are welcome to use the bathroom and the kitchen, we don't have pets, but they are allowed. <\/p>\n<p>If you do not reach me at the number given try this: 022412415106<\/p>\n<p>I want visitors to contact me before camping at my place.<br \/>\n004915773463950<br \/>\n----------------<br \/>\nHallo! Wir haben eine Wiese vor und eine Wiese hinter dem Haus. Auf beiden ist es m\u00f6glich ein gro\u00dfes Zelt aufzuschlagen und es ist, zumindest auf einer Wiese, komplett ebenerdig. Das Bad und die K\u00fcche k\u00f6nnen gerne benutzt werden, Haustiere haben wir keine, sind aber erlaubt. <\/p>\n<p>Falls ihr mich nicht unter der angegebenen Nummer erreicht probiert diese: 022412415106<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n004915773463950<\/p>\n",
