            "description": "<p>\u00dcbernachtet werden kann bei uns im gro\u00dfen Garten; Toilette  und Dusche stellen wir auch zur Verf\u00fcgung; f\u00fcr Fahrradreparaturen kann unsere Werstatt benutzt werden. Falls Zeit ist, unterhalten wir uns gerne beim gemeinsamen Essen.<br \/>\nIm Ort (K\u00e4storf) befindet sich ein B\u00e4cker und im Nachbarort (Gamsen) kann im Supermarkt eingekauft werden.<br \/>\nFast dierekt am Weser-Harz-Heide Radweg gelegen<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015224348603<\/p>\n",
