            "name": "#857 mario",
            "description": "<p>Garten in Kleingartenanlage \"Prie\u00dfnitz\" (Marienstra\u00dfe)<br \/>\nIch habe eine K\u00fcche, Sitzm\u00f6glichkeiten und eine Campingtoilette.<br \/>\nDas Zelt kann auf meiner Wiese aufgestellt werden.<br \/>\nSofern ein Hund meine Beete nicht leer frisst, ist er auch herzlich Willkommen.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n017632529408<\/p>\n",
