            "name": "#856 Andi",
            "description": "<p>Haus mit Garten, verschiedenen Obstb\u00e4umen und Str\u00e4uchern, Terrasse mit Grill sowie Feuerstelle. Toilette, Dusche und notfalls G\u00e4stezimmer mit Ausziehcouch vorhanden.<br \/>\nKinder willkommen, Haustiere m\u00f6glich\u2026<\/p>\n<p>Reisen ist das Einzige, was man kauft, das einen reicher macht.<br \/>\n- Mark Twain -<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon\/WhatsApp\/Signal bei mir melden.<br \/>\nTel. 0172 8449850<\/p>\n<p>Kontakt: hra359@gmail.com<\/p>\n",
