            "description": "<p>Gartenpavillon, Grill, K\u00fchlschrank, Pool kann benutzt werden, Wasser gibt es hinterm Haus. Haustiere erlaubt.<br \/>\nWenn ich Zuhause sein sollte auch Dusche und WC.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015757332963<\/p>\n",
