            "description": "<p>In unserem Garten am Haus gibt es genug Platz f\u00fcr jedes Zelt. Wir freuen uns \u00fcber junge Leute und besonders \u00fcber Radreisende und Wandernde. Wir sind eine Familie mit kleinen Kindern. Bisher hatten wir gute Erfahrungen mit unseren G\u00e4sten - Soll so bleiben :D<\/p>\n<p>Seid so gut und schreibt uns 1-2 S\u00e4tze \u00fcber euch und z.B. von wo-nach-wo ihr unterwegs seit. Das hilft uns ein wenig beim Planen. Danke!<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
