            "description": "<p>Little house at the edge of a forest with a lovely yard for tents.<br \/>\nToilet situation - you can use ours. <\/p>\n<p>We try to allow everyone to stay who asks, however we do ask that there's mutual respect, especially for space and our time. I'm often working late and so cannot entertain people for lots of conversation.<br \/>\nCome, camp, clean up.<br \/>\nThere's woods and a village in the area though!<\/p>\n<p>Please don't bring along dogs, we have a cat and he's terrified of dogs.<br \/>\nOnly for visitors by bike or on foot, no cars.<\/p>\n<p>I want visitors to contact me efore camping at my place.<br \/>\n0471539354<\/p>\n",
