            "description": "<p>Hallo!<br \/>\nHerzlich Willkommen auf unserem Hof direkt am Wanderweg \u201eNordpfad Gilkenheide\u201c. Am Waldrand gelegen bieten wir dir einen herrlichen Schlafplatz zwischen Obstb\u00e4umen und alten Eichen.<br \/>\nAuf unserem Hof steht dir nach Absprache auch ein G\u00e4stebad in unserem Haus zur Verf\u00fcgung.<br \/>\nBitte melde dich vor deiner Anreise an.<br \/>\nWir freuen uns auf eine spannende Begegnung!<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n04262-9184620<\/p>\n",
