            "description": "<p>Hallo Freunde!<\/p>\n<p>\u00dcbernachtung im Zelt oder Fahrradwohnwagen f\u00fcr 1 Nacht kostenlos!<br \/>\nEs gibt eine Au\u00dfen-Wassertoilette, Dusche,  Strom und auch eine Waschmaschine, die f\u00fcr einen geringen Obolus genutzt werden k\u00f6nnen (bis auf die Toilette, die kostet nichts!).<br \/>\nDa ich selbst Tiere (Katze, Kaninchen, Ponys) habe, ist das Mitbringen eines Hundes nicht m\u00f6glich!<br \/>\nIch bin hin und wieder selbst unterwegs, mein Grundst\u00fcck ist eingez\u00e4unt, weshalb zwingend im Vorfeld angefragt werden muss, ob das Campen bei mir m\u00f6glich ist!<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n+4915228724241<\/p>\n",
