            "name": "#643 Tom und Ute",
            "description": "<p>Wir wohnen in der Waldsiedlung bei Nauen in einem Haus mit gro\u00dfem Garten 500 m vom Havelland-Radweg entfernt. Superm\u00e4rkte, Gastst\u00e4tten und Bahnanschluss befinden sich im 4 km entfernten Nauen. Bei uns im Garten haben 1 bis 2 kleine Zelte Platz, es gibt eine Gartendusche, Outdoortoilette (Trenntoilette) und eine \u00fcberdachte Sitzm\u00f6glichkeit.<br \/>\nFahrradtouristen und Wanderer sind willkommen.<\/p>\n<p>Dem Anbieter ist wichtig, dass sich die G\u00e4ste vorher kurz vorstellen!<br \/>\n017699767910<\/p>\n",
