            "description": "<p>Da ich beim Wandern und Radeln auch oft einen Platz f\u00fcr mein Zelt suche, biete ich hier einen Platz bei uns an.<br \/>\nIhr k\u00f6nnt im Garten zelten, bei schlechtem Wetter bringen wir Dich\/Euch in unserem Backhaus unter.<br \/>\nStrom und Wasser k\u00f6nnt Ihr von uns bekommen.<br \/>\nKlo gibt's auch.<br \/>\nWer Angst oder eine Allergie vor Hunden hat: Hier seid Ihr dann leider falsch. Wir haben zwei gro\u00dfe Pudel und die freuen sich immer sehr \u00fcber menschlichen und tierischen Besuch.<br \/>\nBitte schickt eine Nachricht bevor Ihr kommt.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015788180438<\/p>\n",
