            "name": "#615 jtUdo",
            "description": "<p>Wanderer-Rastplatz HeuKate<br \/>\nRuhe, Erholung, Natur im Lassaner Winkel \u2013 vor den Toren Usedoms.<\/p>\n<p>Unser Grundst\u00fcck, ein ehemaliger Bauernhof, liegt in Zarrentin, einem Dorf mit 10 H\u00e4usern, umrahmt von Feldern,Wald und<br \/>\nMoor - ein Biotop mit V\u00f6geln, Fr\u00f6schen, Reet und Weiden, abseits der Hauptstra\u00dfen.<br \/>\nWir hei\u00dfen Singles, kleine und gro\u00dfe Familien oder Wandergruppen (auch mit Haustieren) willkommen.<\/p>\n<p>In 8 Kilometern Entfernung liegt das idyllische Lassan mit seinem Hafen am Achterwasser. Hier gibt es B\u00e4cker, Supermarkt, Museum und Gastronomie.<br \/>\nBahnhof (ICE) und Einkauf in Anklam (10 km).<\/p>\n<p>Benutzung von Toilette, Dusche, Sauna, Waschmaschine und Kochen am Lagerfeuer oder Fr\u00fchst\u00fcck auf der Terrasse sind m\u00f6glich.<br \/>\nEine Segeltour auf dem Achterwasser kann gebucht werden.<\/p>\n<p>Weitere Informationen finden Sie unter https:\/\/heukate.hpage.com\/<\/p>\n",
            "link": "heukate@gmx-topmail.de",
