            "description": "<p>Wir k\u00f6nnen zwei M\u00f6glichkeiten anbieten:<br \/>\nF\u00fcr nur ein oder zwei Zelte die Wiese hinter unserem Haus (Obstb\u00e4ume, Gem\u00fcsegarten, Beerenstr\u00e4ucher \u2013 hier kann man sich reichlich bedienen je nach Jahreszeit).<br \/>\nEine Komposttoilette, Grillm\u00f6glichkeit und Solardusche ist vorhanden.<br \/>\nKochm\u00f6glichkeit und kleiner K\u00fchlschrank in unserem kleinen Gartenh\u00e4uschen k\u00f6nnen genutzt werden.<br \/>\nAber \u2013 unser Hund, unsere 3 Zwergh\u00fchner laufen frei auf dem Gel\u00e4nde und der Hahn kr\u00e4ht recht fr\u00fch\u2026<br \/>\nEin wundersch\u00f6ner ansonsten ruhiger Platz zum entspannen.<br \/>\nDie zweite M\u00f6glichkeit:<br \/>\nPlatz f\u00fcr mehrere Zelte auf unserer Wiese am Ortsende (eingez\u00e4unt mit Obstb\u00e4umen, Beerenstr\u00e4uchern\u2026und vielen freilaufenden Tieren (die man kurzfristig auch aussperren kann)).<br \/>\nHier haben wir Grillm\u00f6glichkeiten, Komposttoilette, Gasherd\u2026..Frischwasser allerdings nur per Kanister und keine Dusche.<br \/>\nWir w\u00fcrden uns \u00fcber gem\u00fctliche Grillabende (keine Saufgelage!) gemeinsam mit den Campern freuen und spielen sebst E-Gitarre\u2026<\/p>\n<p>Wir haben Fahrr\u00e4der, die wir zur Verf\u00fcgung stellen k\u00f6nnen, sowie ein Kanu, mit dem man auf der nahen Uecker einsetzten kann und bis nach Prenzlau oder Pasewalk paddeln kann.<br \/>\nUnser Ort liegt auf dem Radfernweg Berlin-Usedom (Wir unterhalten auch eine kleine, kostenlose Rad-Reparatur-Werkstatt f\u00fcr Notreparaturen)<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n01706927689<\/p>\n",
