            "name": "#595 Marion",
            "description": "<p>Hallo!<br \/>\nWir bieten einen Zeltplatz in unserem Garten an.<br \/>\nDer Untergrund ist Rasen, es steht aber auch eine gepflasterte Fl\u00e4che zur Verf\u00fcgung.<br \/>\nWasseranschlu\u00df und Grillm\u00f6glichkeit ist vorhanden.<br \/>\nNach Absprache kann das Bad im Haus mitgenutzt werden.<br \/>\nFahrr\u00e4der k\u00f6nnen gerne sicher in der Garage abgestellt werden.<br \/>\nDa wir 2 Katzen haben bitte keine Haustiere mitbringen.<\/p>\n<p>Wir freuen uns auf spannende Begegnungen!<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
