            "description": "<p>Ein Platz in meinem Garten unterm Birnbaum mit weiten Blick in die Landschaft.<br \/>\nWC und Waschm\u00f6glichkeiten k\u00f6nnen im Wohnhaus genutzt werden.<br \/>\nHaustiere sind nicht erw\u00fcnscht.<br \/>\nIn der N\u00e4he befinden sich Seen und eine wundersch\u00f6ne Landschaft.<br \/>\nFeldberg ist mit Einkaufsm\u00f6glichkeiten ca. 7 km entfernt.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n017630720692<\/p>\n",
