            "description": "<p>Moin, auf unserem Hof gibt es mehrere Wiesen zum Zelten, direkt am X8 Talweg gelegen.<br \/>\nIhr habt Zugang zu einer Toilette mit Waschbecken.<br \/>\nBitte keine Haustiere. (Wir haben zwei Hunde auf dem Hof)<\/p>\n<p>Wenn Ihr euch vorher anmeldet, w\u00e4re klasse, sollte das aus irgendwelchen (guten) Gr\u00fcnden nicht klappen, m\u00fcssen wir eben spontan sein\u2026<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
