            "description": "<p>Hallo!<br \/>\nWir stellen unseren Garten zum Zelten zur Verf\u00fcgung.<br \/>\nEin Wasseranschluss ist vorhanden und wenn wir da sind, kann das Badezimmer mit Dusche und WC gerne mitbenutzt werden.<br \/>\nDie Waschmaschine steht ebenfalls bereit.<br \/>\nMehrere Einkaufm\u00f6glichkeiten sind in 300m erreichbar, genauso wie ein Fahrradgesch\u00e4ft, Drogeriem\u00e4rkte und Apotheken.<br \/>\nEs w\u00e4re super, wenn Ihr euch vorher bei uns melden w\u00fcrdet.<br \/>\nWir freuen uns auf Dich\/Euch!<\/p>\n<p>Bis bald, die Familie Hermann<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015775465206<\/p>\n",
