            "description": "<p>Moin, wir leben mitten im Wald im Herzen des sch\u00f6nen Sollings, da Campen direkt im Wald nicht \"erlaubt\" ist, bieten wir in unserem gro\u00dfen Garten gerne eine Alternative zum \u00dcbernachten an.<br \/>\nWir sind eine kleine Familie mit zwei Jungs und einem Hund.<br \/>\nG\u00e4stedusche u. WC k\u00f6nnen gerne genutzt werden, es gibt in den Sommermonaten eine Sitzgelegenheit mit Feuerstelle.<br \/>\nCAVE: Diejenigen, die mit dem Rad anreisen, m\u00fcssen jedoch zun\u00e4chst einen 4km Climb mit ca. 200 HM von Holzminden nach M\u00fchlenberg bezwingen, als Belohnung gibt es daf\u00fcr aber ein gek\u00fchltes Allersheimer (lokales Bier) als Belohnung.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
