            "name": "#517 MrIh",
            "description": "<p>Hallo zusammen, hier biete ich euch einen Platz zum Zelten \u2013 Parken direkt vor Ort nicht m\u00f6glich.<br \/>\nPlatz befindet sich ca. 100m hinter unserem Haus.<br \/>\nSch\u00f6ne Aussicht mit Feuerstelle und einer H\u00fctte.<br \/>\nDie \u00fcberdachte Terrasse mit Sitzpl\u00e4tzen kann nach R\u00fccksprache mit verwendet werden.<br \/>\nBoden ist leicht schief, aber noch gut zum Zelten.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n0176\/24777268<\/p>\n<p>Kontakt: patrick.ihrlich@gmail.com<br \/>\nI want visitors to contact me before camping at my place via email or phone.<\/p>\n",
