            "description": "<p>Hallo,<br \/>\nnach Absprache gibt es hier einen sch\u00f6nen Stellplatz in einem eingez\u00e4unten Garten.<br \/>\nStrom und flie\u00dfendes Wasser gibt es aktuell noch nicht. Wasser kann aber beim Abholen des Schl\u00fcssels aufgef\u00fcllt werden.<br \/>\nDaf\u00fcr ist ruhig mit fantastischem Ausblick.<br \/>\nIch hoffe, dass wir im Sommer mit der Trenntoilette und dem befestigten Stellplatz fertig werden.<br \/>\nHunde sind kein Problem solange die Hinterlassenschaften entfernt werden.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n+491727752614<\/p>\n",
