            "description": "<p>In unserem Garten ist Platz f\u00fcr ein-zwei gr\u00f6\u00dfere oder mehrere kleine Zelte.<br \/>\nEs gibt flie\u00dfend kaltes Wasser.<br \/>\nAuf Anfrage kann sich gerne Fahrradwerkzeug ausgeliehen werden.<br \/>\nNach Absprache kann in einer Feuerschale auch Feuer gemacht werden.<br \/>\nBei anderen Fragen einfach kurz eine Mail an 2017cata04@gmail.com<\/p>\n<p>Voranmeldung n\u00f6tig!<br \/>\n--------------<br \/>\nIn our garden is room for up to two bigger tents or three to four smaller ones.<br \/>\nThere is running cold water available.<br \/>\nIf you ask nice you are welcome to use our tools for bike repairing.<br \/>\nIn accordance with us you can make a small fire in a fire bowl.<\/p>\n<p>If you have any other questions just write a mail to 2017cata0<\/p>\n<p>I want visitors to contact me before camping at my place via email or phone.<br \/>\n015252719914<\/p>\n",
