            "name": "#495 Lurifeebijo",
            "description": "<p>Hallo liebe Reiseliebhaber,<br \/>\nWir bieten eine eingez\u00e4unte Wiese und einen gro\u00dfen Garten. Beides steht zur Verf\u00fcgung. Wir leben am ruhigen Randes des Ruhrgebiets auf dem Land, innerhalb von 30min ist man aber in Dortmund, Bochum usw..<br \/>\nN\u00e4he der A2, \u00d6ffis m\u00f6glich, Wasser \/ Strom da, Bad auf Anfrage.<br \/>\nWir haben einen lieben Hund und eine Katze. Haustiere auf Anfrage gerne.<br \/>\nBei Wetternot sind ein Bauwagen und eine Halle vorhanden.<br \/>\nLidl sportlich laufnah (20min). Haard 15min Autofahrt.<br \/>\nFalls mit dem Wohnmobil angereist wird ist ein Stellplatz vorhanden.<br \/>\nEinen Kaffee gibt es auch gerne immer\u2026<\/p>\n<p>Bitte vorher anfragen :)<br \/>\nLG und auf eine tolle Reise<br \/>\nRia & Lucia & Fee<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015789739429<\/p>\n",
