            "name": "#486 PROM2",
            "description": "<p>Best for one or two tents, children welcome, no dogs.<br \/>\nQuiet green garden around our house, here are living a cat, two rabbits and four chickens, and a family of four.<br \/>\nYou will have a basic shower and a toilet for your own.<br \/>\nCampfire and BBQ is possible every day.<br \/>\nSmall workshop for bikes available (tools, tyres, pump). If it rains heavily or if snow is falling we will find a dry place.<br \/>\nZandt village is approx. 45 mins (biking) coming from North \u2013 Altm\u00fchl valley (via Kipfenberg or Beilngries).<br \/>\nFrom Zandt you will reach Ingolstadt City in 60 mins (biking) through beautiful woods. Next busstop, bakery or supermarket within 3 kms.<\/p>\n<p>I want visitors to contact me before camping at my place via email or phone.<br \/>\n084666889911<\/p>\n",
