            "name": "#485 Gemeinschaft der Sonderlinge e.V.",
            "description": "<p>Hallo,<br \/>\nunser Gemeinschaftsgarten Nr. 6 (inkl. 4,5,7,8) liegt in der Schrebergartenanlage in Ahorn bei Coburg.<br \/>\nWir haben dort drei Holzh\u00fctten, eine \u00dcberdachung, Toilettenst\u00fchle, eine Trinkwasserquelle und zwei kleine Zeltwiesen (Nr.4) f\u00fcr drei kleinere Zelte.<br \/>\nDer Garten hat S\u00fcdhanglage und schenkt uns bei sonnigem Wetter den ganzen Tag Sonne.<br \/>\nDrei Viertel des Gartens sind mit allerlei Beerenobst kultiviert.<br \/>\nDer obere Bereich ist f\u00fcr unsere Mitglieder gastronomisch ausgerichtet, d.h. er bietet Platz f\u00fcr private Feierlichkeiten.<\/p>\n<p>Telefonischer Kontakt bevorzugt: 0151  15 84 67 61 oder:  09561 \/  10307 werktags zwischen 10 bis 18 Uhr<br \/>\nFrau Fleming<\/p>\n<p>I want visitors to contact me before camping at my place via email or phone.<\/p>\n",
