            "description": "<p>Hallo, wir bieten euch einen tollen Zeltplatz in einem ruhigen ehemals Denkmal gesch\u00fctzten Dorf im Oberen Vogtland mit einer herrlichen Aussicht auf das Vogtland.<br \/>\nAuf unserem gro\u00dfen Grundst\u00fcck k\u00f6nnt ihr euch gern ausbreiten. Die Wiese ist nicht ganz eben, aber gepflegt.<br \/>\nWasser, Strom k\u00f6nnt ihr nutzen, ein Grill und eine Lagerfeuer Platz (Holz u. Kohle gegen Obulus) sind auch da. Den Toiletten Gang m\u00fcssen wir vorher kl\u00e4ren.<br \/>\nAuf Tiere (ausser Kleine) m\u00fcsst ihr leider verzichten.<br \/>\nWLAN To Go ist vorhanden.<br \/>\nBitte telefonisch anmelden.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\nbesser +49 170 7781139<\/p>\n",
