            "name": "#366 Junefotografie",
            "description": "<p>Dies ist unser gepachtets Gartenparadies. Wir starteten hier im Jahr 2018 und gestalten es nun langsam nach Permakultur Prinzipien um, zwei der Grunds\u00e4tze passen ziemlich perfekt zum 1nitetent, n\u00e4mlich \"people care\" und \"faire share\".<br \/>\nSeid uns also herzlich Willkommen!<br \/>\nIhr findet hier:<br \/>\nRuhe<br \/>\nH\u00fchner der Nachbarn<br \/>\nFr\u00fcchte<br \/>\nBienen (Bienenv\u00f6lker stehen am Rand des Gartens)<br \/>\nFeuerstelle mit Holz<br \/>\nTrockentrenntoilette<br \/>\nDirekte Anbindung zum Fahrradweg und Pilgerweg<br \/>\nB\u00e4cker im Dorf<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n0177 2058133<\/p>\n",
