            "name": "#126 Landidyll",
            "description": "<p>Hello beautiful people,<br \/>\nyou're welcome to use our garden with your tent. There is enough place for a big tent as well.<br \/>\nIf you have a friendly dog (we have one, too) you may bring him or her with you.<br \/>\nIf we are at home you can use our bathroom.<br \/>\nThere is a fireplace which you can use as well.<br \/>\nIf you like hiking you are at the right place to be! There is a lot of wonderful nature around to take long walks.<br \/>\nNo shopping possibilities in the village.<br \/>\nPlease notice that we live very rural in a tiny village and we do like our neighbors very much. As we would like that they do the same, we ask you to be respectful and quiet in the nighttime.<br \/>\nPlease let us know when you are planing to visit our place via phone or mail.<\/p>\n<p>I want visitors to contact me before camping at my place via email or phone.<br \/>\n0160\/7961918<\/p>\n",
