            "description": "<p>Freien Blick auf den Sonnenuntergang? Wie in der Wildnis ohne ein Geb\u00e4ude im Weg?<br \/>\nAm Waldrand des Haselhof k\u00f6nnt Ihr Euer Zelt neben einer alten Eiche aufstellen. Kein Haus, keine Stra\u00dfe oder irgendetwas von der Zivilisation wird Euren Blick auf einen fast endlosen Abendhimmel tr\u00fcben.<br \/>\nSogar zu unserem Bauernhaus trennen Euch 50 Meter Wald.<br \/>\nPures Wildnisfeeling und trotzdem legal campieren incl. Grill\/Feuerplatz, Trinkwasser und Trockentoilette.<\/p>\n<p>Fotos von unserer Oase gibt es \u00fcber bloghausromantik @ instagram<br \/>\noder www.facebook.com\/bloghausromantik<\/p>\n<p>Kurzfristige Anmeldungen sind auch per Mail m\u00f6glich.<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<\/p>\n",
