            "description": "<p>Auf unserem gem\u00fctlichen Hof mit gro\u00dfem Grundst\u00fcck zum Zelten, 2 Feuerstellen, Backhaus mit Steinofen (feuern wir nur bei Bedarf mit mehreren G\u00e4sten an), H\u00fchnern??, demnach also morgens frisch gelegte ?er, gute Mucke, von Rock bis Goa ??, oder einfach Ruhe am kleinen Bachlauf \u2026..l\u00e4dt zum verweilen ein !<br \/>\nWir haben 2 Hunde und haben nichts gegen andere, sofern sie den Knigge gelesen haben ?<br \/>\nBei Bedarf k\u00f6nnen wir was leckeres zum grillen vom Bauer nebenan organisieren, ne Dusche und Kaffee gibts ehmso !<br \/>\nWir sind beide um die 50, leben f\u00fcr freedom, Goa, Harley und Chopperculture ?<br \/>\nBiker sind herzlich willkommen und wir freuen uns auf nette Begegnungen ??<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n017622945637<\/p>\n",
