            "description": "<p>Biete Platz f\u00fcr Naturliebhaber auf einer Pferdekoppel.<br \/>\nEin angrenzender Bach bringt am hei\u00dfen Tagen Abk\u00fchlung.<br \/>\nBei optimalen Bedingungen kann ein Lagerfeuer gemacht werden. <\/p>\n<p>Bitte immer vorher mit mir in Verbindung treten \u00fcber WhatsApp oder einen Anruf.<br \/>\n01607516163<\/p>\n<p>Biete keinen Wohnwagenplatz oder Platz f\u00fcr Mehrtages-Urlauber.<\/p>\n",
