            "description": "<p>Auf meinem Hof leben wir Menschen gemeinsam mit Eseln, Ziegen, Schafe, H\u00fchner, Katzen und H\u00fchnern.<br \/>\nIch biete Freizeitaktivit\u00e4ten mit Tieren, wie Wanderungen mit Eseln und Schafen an.<br \/>\nDer Hof liegt idyllisch am Rande des sch\u00f6nen Ortes Preetz in einem Landschaftsschutzgebiet.<br \/>\nHunde sind bei uns willkommen.<br \/>\nToilette mit Waschbecken kann genutzt werden. Auch Zugang zu Strom ist m\u00f6glich.<br \/>\nSchaut auf meine Website: Lohmuehlenhof.de<\/p>\n<p>Ich m\u00f6chte, dass sich G\u00e4ste vorher per E-Mail oder Telefon bei mir anmelden.<br \/>\n015111914730<\/p>\n",
