            "name": "#26 Stiftung Naturschutz Schleswig Holstein",
            "description": "<p>Dieser \u00dcbernachtungsplatz wird von der Stiftung Naturschutz Schleswig-Holstein zur Verf\u00fcgung gestellt. Es handelt sich um eine kleine Fl\u00e4che zwischen zwei Weiden, die direkt hinter dem Deich liegt.<br \/>\nWer sein Abendbrot auf den Deich verlegt, kann dabei Meerblick genie\u00dfen. \u00dcber die Qualit\u00e4t als Badestelle ist nichts bekannt.<\/p>\n<p>- kein Feuer<br \/>\n- max. zwei Zelte<br \/>\n- Naturfreunde zu Fu\u00df oder mit dem Rad<br \/>\n- besteht vor Ort nicht die M\u00f6glichkeit einer WC-Nutzung, sind Exkremente zu vergraben<\/p>\n<p>Anmeldung nicht erforderlich.<\/p>\n",
