            "name": "#25 Stiftung Naturschutz Schleswig Holstein",
            "description": "<p>Dieser \u00dcbernachtunsplatz wird von der Stiftung Naturschutz Schleswig-Holstein angeboten. Der Platz liegt mitten im Stiftungsland Sch\u00e4ferhaus (Kreis Schleswig-Flensburg), einem ehemaligem Truppen\u00fcbungsplatz. Bei diesem \u00dcbernachtungsplatz kann das Zelt in N\u00e4he der Skulptur neben dem ber\u00fchmten \"Ochsenweg\", einem historischen Landweg, aufgeschlagen werden.<\/p>\n<p>Der \u00dcbernachtungsplatz ist aufgrund der dort stehenden Holz-Skulptur, die zwei symbolische Ochsenh\u00f6rner darstellt, nicht zu verfehlen.<br \/>\n- F\u00fcr Radler oder Wanderer<br \/>\n- max. 2 Zelte<br \/>\n- kein offenes Feuer<br \/>\n- besteht vor Ort nicht die M\u00f6glichkeit einer WC-Nutzung, sind Exkremente zu vergraben<\/p>\n<p>Anmeldung nicht erfolderlich.<\/p>\n",
