            "name": "#23 Stiftung Naturschutz Schleswig Holstein",
            "description": "<p>Dieser \u00dcbernachtungsplatz wird von der Stiftung Naturschutz im Stiftungsland Hessenstein (Kreis Pl\u00f6n) zur Verf\u00fcgung gestellt. Es handelt sich um eine Freifl\u00e4che in der N\u00e4he eines Erlenbruchs, direkt am Wanderweg.<br \/>\nIn der N\u00e4he befinden sich Sehensw\u00fcrdigkeiten wie die Turmh\u00fcgelburg und das Eiszeitmuseum.<br \/>\n- kein Feuer<br \/>\n- max. zwei Zelte<br \/>\n- Naturfreunde zu Fu\u00df oder mit dem Rad<br \/>\n- besteht vor Ort nicht die M\u00f6glichkeit einer WC-Nutzung, sind Exkremente zu vergraben<\/p>\n<p>Anmeldung nicht erforderlich.<\/p>\n",
