            "description": "<p>Dieser \u00dcbernachtungsplatz der Stiftung Naturschutz liegt in einem kleinen Waldst\u00fcck in Kudensee (Dithmarschen). Er bietet einen Blick auf das Naturschutzgebiet Kleve mit dem sogenannten Spiekerberg. Der Spiekerberg ist ein eindrucksvoller Zeuge der Zeit - er ist der ehemaligen Rand der Nordsee (Kleve = Kliff). Wenn die Heide bl\u00fcht, ist dieser Berg inmitten der eher flachen Landschaft besonders sch\u00f6n anzusehen. Es f\u00fchren Wanderwege durch das Naturschutzgebiet.<\/p>\n<p>- kein Feuer<br \/>\n- max. zwei Zelte<br \/>\n- Naturfreunde zu Fu\u00df oder mit dem Rad<br \/>\n- besteht vor Ort nicht die M\u00f6glichkeit einer WC-Nutzung, sind Exkremente zu vergraben<\/p>\n<p>Anmeldung nicht erforderlich.<\/p>\n",
